import React, {Component} from "react";

export interface ServerInterface {
    name: string;
    distance: number;
}

class Server extends Component<ServerInterface, {}> {
    render() {
        return (
            <div key={this.props.name}>
                {this.props.name} - {this.props.distance}
            </div>
        );
    }
}

export default Server;
